import React, { useState } from 'react';
import '../../App.css';

export default function Products() {
  const [articles, setArticles] = useState([
    {
      id: 1,
      name: 'Canon 70D',
      image: 'https//via.placeholder.com/500x500',
    },
    {
      id: 2,
      name: 'Canon 80D',
      image: 'https//via.placeholder.com/500x500',
    },
    {
      id: 3,
      name: 'Canon 60D',
      image: 'https//via.placeholder.com/500x500',
    },
  ]);

  return <h1 className='products'>PRODUCTS</h1>;
}
